      <div class="container">

         <div class="under-construction">
         <style>
            svg{
               max-width: 60%;
            }

            svg#freepik_stories-under-construction:not(.animated) .animable {
               opacity: 0;
            }
         
            svg#freepik_stories-under-construction.animated #freepik--background-complete--inject-1 {
               animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) lightSpeedLeft;
               animation-delay: 0s;
            }
         
            svg#freepik_stories-under-construction.animated #freepik--Shadow--inject-1 {
               animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideDown;
               animation-delay: 0s;
            }
         
            svg#freepik_stories-under-construction.animated #freepik--Cone--inject-1 {
               animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideRight;
               animation-delay: 0s;
            }
         
            svg#freepik_stories-under-construction.animated #freepik--Character--inject-1 {
               animation: 4.0s 1 forwards ease-in slideLeft, 1.5s Infinite linear floating;
               animation-delay: 0s, 4s;
            }
         
            svg#freepik_stories-under-construction.animated #freepik--Sign--inject-1 {
               animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideRight;
               animation-delay: 0s;
            }
         
            svg#freepik_stories-under-construction.animated #freepik--Tools--inject-1 {
               animation: 1.9s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) zoomOut, 1.5s Infinite linear wind;
               animation-delay: 0s, 1.9s;
            }
         
            @keyframes lightSpeedLeft {
               from {
                  transform: translate3d(-50%, 0, 0) skewX(20deg);
                  opacity: 0;
               }
         
               60% {
                  transform: skewX(-10deg);
                  opacity: 1;
               }
         
               80% {
                  transform: skewX(2deg);
               }
         
               to {
                  opacity: 1;
                  transform: translate3d(0, 0, 0);
               }
            }
         
            @keyframes slideDown {
               0% {
                  opacity: 0;
                  transform: translateY(-30px);
               }
         
               100% {
                  opacity: 1;
                  transform: translateY(0);
               }
            }
         
            @keyframes slideRight {
               0% {
                  opacity: 0;
                  transform: translateX(30px);
               }
         
               100% {
                  opacity: 1;
                  transform: translateX(0);
               }
            }
         
            @keyframes slideLeft {
               0% {
                  opacity: 0;
                  transform: translateX(-30px);
               }
         
               100% {
                  opacity: 1;
                  transform: translateX(0);
               }
            }
         
            @keyframes floating {
               0% {
                  opacity: 1;
                  transform: translateY(0px);
               }
         
               50% {
                  transform: translateY(-10px);
               }
         
               100% {
                  opacity: 1;
                  transform: translateY(0px);
               }
            }
         
            @keyframes zoomOut {
               0% {
                  opacity: 0;
                  transform: scale(1.5);
               }
         
               100% {
                  opacity: 1;
                  transform: scale(1);
               }
            }
         
            @keyframes wind {
               0% {
                  transform: rotate(0deg);
               }
         
               25% {
                  transform: rotate(1deg);
               }
         
               75% {
                  transform: rotate(-1deg);
               }
            }
         </style>
